import "./GenreList.css";
export default function GenreList(props) {
  {
    genres?.map((genre) => <GenreList genres={genre} />);
  }
  return (
    <div className="genre-dropbox-click">
      <div className="genre-dropbox">
        <p className="genre">{genre.name}</p>
      </div>
    </div>
  );
}
